package assignment1;

public class DataTypes {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		byte b = 10;
		short s = 1000;
		int i = 10000;
		long l = 1000000L;
		float f = 10.089f;
		double d = 10.089999999999;
		char c = 'a';
		boolean bo = false;
		System.out.println("Datatypes Example : \n" + b + "\n" + s + "\n" + i + "\n" + l + "\n" + f + "\n" + d + "\n"
				+ c + "\n" + bo + "\n");
	}

}
